import React, { Component } from 'react';
import './App.css';
import { Route, Switch, Link } from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Link to='/'>Home</Link>
        <Link to='/shops'>Shops</Link>
        <Switch>
          <Route path='/' exact component={Home} />
          <Route path='/shops' render={() => <Shops />} />
        </Switch>
      </div>
    );
  }
}

